// src/components/FrontPage.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './FrontPage.css'; // Updated CSS file

function FrontPage() {
  const navigate = useNavigate();

  return (
    <div className="front-page">
      {/* Hero Section */}
      <header className="hero">
        <img src="/logo.jpg" alt="CSECU Logo" className="logo" />
        <h1 className="hero-title">Welcome to the CSECU Family</h1>
        <p className="hero-subtitle">
          Empowering Future Engineers with Innovation and Knowledge
        </p>
      </header>

      {/* Main Content */}
      <main className="content">
        <div className="button-group">
          <button className="btn primary" onClick={() => navigate('/signup')}>
            Sign Up
          </button>
          <button className="btn secondary" onClick={() => navigate('/login')}>
            Login
          </button>
        </div>
      </main>

      {/* Footer */}
      <footer className="footer">
        <p>Â© {new Date().getFullYear()} CSECU. All Rights Reserved.</p>
      </footer>
    </div>
  );
}

export default FrontPage;
